import { AppBar, Grid, Typography } from "@mui/material";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="MenuBar">
      <AppBar position="static">
        <Grid container justifyContent="flex-end" height={50}>
          <Grid
            container
            item
            lg={3}
            md={4}
            xs={12}
            spacing={3}
            alignItems="center"
            sx={{
              backgroundColor: 'red'
            }}
          >
            <Grid item lg={3} md={3} xs={3}>
              <Link to="/home">
                <Typography sx={{ color: 'white' }}>
                  Home
                </Typography>
              </Link>
            </Grid>
            <Grid item lg={3} md={3} xs={3}>
              <Link to="/about"> <Typography sx={{ color: 'white' }}>
                About
              </Typography></Link>
            </Grid>
            <Grid item lg={3} md={3} xs={3}>
              <Link to="/projects"> <Typography sx={{ color: 'white' }}>
                Projects
              </Typography></Link>
            </Grid>
            <Grid item lg={3} md={3} xs={3}>
              <Link to="/contacts"> <Typography sx={{ color: 'white' }}>
                Contacts
              </Typography></Link>
            </Grid>
          </Grid>
        </Grid>
      </AppBar>
    </div>
  );
};

export default NavBar;
